import logo from './logo.svg';
import './MyApp.css';
import Hello from './Hello';
import reactDom from 'react-dom';


function MyAppSub() {

  let cnt = 1;

  const dataList = [1,2,3];

  const dataMsgList = dataList((a)=>{return <div>{a}</div>});

  return (
    <div className="MyApp">
      <header className="App-header">
      </header>
      <h1>available {cnt}</h1>
    </div>
  );
}

// reactDom.render(
